    "Evaluation of grazing treatments on the Lake Mason National Wildlife Refuge within
    the sage grouse initiative program lands for greater sage-grouse habitat and population
    dynamics in central Montana",nt"tracking_summary": {ntt"total": 2,ntt"recent":
    0nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T23:05:20.000924",nt"name": "evaluation-of-grazing-treatments-on-the-lake-mason-national-wildlife-refuge-within-the-sag",nt"isopen":
    false,nt"url": null,nt"notes": "We are proposing to engage in a currently
    ongoing, long-term (6 year) study evaluating the direct effects of grazing treatments
    on greater sage-grouse (Centrocercus urophasianus). Habitat composition, habitat
    selection, and vital rates for Greater Sage Grouse are being determined for over
    a 100,000 acres of federal and private lands both to the west and east of Lake Mason
    NWR. We propose to engage with this project and expand the landscape-level GIS map
    and our vegetation sampling regarding effects of livestock grazing on sagegrouse
    habitat to the three units that comprise the Lake Mason National Wildlife Refuge
    in Musselshell County, Montana.",nt"license_title": "License Not Specified",nt"extras":
